import React from 'react';

import classes from './Table.module.css';

const table = props => {
    const headers = null
    const body = props.data.map( value => {
        return (
            <tr>
                {
                    Object.keys( value ) .map( x => {
                        <td> { value[x] }</td>
                    })
                }
            </tr>
        )
    });
    return (
        <table className={classes.Table}>
            <thead>
                <tr>
                    <td>1</td>
                    <td>2</td>
                    <td>3</td>
                    <td>4</td>
                    <td>1</td>
                    <td>2</td>
                    <td>3</td>
                    <td>4</td>
                </tr>
            </thead>
            <tbody>
                { body }
            </tbody>
        </table>
    )
};

export default table;
